  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0143390 includes discrete
  sample and profile data collected from THOMAS WASHINGTON in the Gulf of Alaska and
  North Pacific Ocean from 1984-05-04 to 1984-06-04 and retrieved during cruise P16_1984a.
  These data include BAROMETRIC PRESSURE, DISSOLVED OXYGEN, HYDROSTATIC PRESSURE,
  NITRATE, NITRITE, SALINITY, Tritium (Hydrogen isotope), WATER TEMPERATURE, phosphate
  and silicate. The instruments used to collect these data include CTD and bottle.nnThese
  data were collected by Roland A. de Szoeke of Oregon State University; College of
  Earth, Ocean, and Atmospheric Sciences and Lynne Talley of University of California
  - San Diego; Scripps Institution of Oceanography as part of the P16N_31WT19840504
  data set.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
